UPDATE `ShopItems` SET `id` = 'a6f80c96-516a-11dd-a89a-000e0c431b58', `itemName` = 'Краска ВД акриловая д/обоев DALI 2,5л (Рогнеда)', `group` = 'a6f80c91-516a-11dd-a89a-000e0c431b58', `action` = '0', `amount` = '197', `minAmount` = '35', `description` = 'Краска DALI акриловая для обоев обладает отличной адгезией к бумажным, флизелиновым и стеклообоям. Благодаря специально разработанному составу, краска DALI обладает хорошей укрывистостью и без проблем наносится на обои под покраску, сохраняя фактуру. Так же краска DALI может быть нанесена на минеральные поверхности, такие как гипсокартон, штукатурки, шпатлевки и тому подобные покрытия. Единственным условием к поверхности - нормальная влажность и температура в помещении, в котором производятся работы. Краска Dali содержит в составе специальные антибактериальные добавки, препятствующие образованию и размножению био организмов и бактерий. Кроме того краска DALI устойчива к влажной уборке и применению моющих средств, что делает стены и потолок помещения долговечными. Существуют две разновидности краски DALI - база А, подходящая и для машинной и для ручной колеровки, и база С, подходящая только для машинной колеровки. Купить и заколеровать краску DALI, а так же другую продукцию компании Рогнеда Вы можете в интернет магазине СтройБери, а так же в сети розничных магазинов.', `shown` = '1' WHERE `id` = 'a6f80c96-516a-11dd-a89a-000e0c431b58';
