INSERT INTO `ShopGroups` (`id`, `groupName`, `shown`, `showInHierarchy`) VALUES ('75d66d49-99a5-11db-937f-000e0c431b59', 'Краски "ЛАКРА"', '1', '1'), ('27566c6a-9ed8-11e3-96ad-005056be1f7b', 'Декоративные покрытия(для внутренних и наружных работ)', '1', '1'), ('076d216a-4380-11de-8f53-000e0c431b58', 'Колер', '1', '1');
INSERT INTO `ShopProperties` (`id`, `propertyName`, `filterType`, `valueType`, `oneOfAllValues`) VALUES ('1ea6fcc4-d206-11e4-9be0-005056be1f7c', 'Размер зерна (мм)', 'intRange', 'float', '0'), ('d17cb785-d20b-11e4-9be0-005056be1f7c', 'Объем (мл.)', 'intRange', 'float', '0');
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES ('b7e2864b-21de-11df-860d-000e0c431b58', 'Краска фактурная Белый 18 кг ("Лакра")', '27566c6a-9ed8-11e3-96ad-005056be1f7b', '0', '507', '21', 'Краска представляет собой белую вязкую однородную массу. Удобна в нанесении, легка в обработке, имеет высокую адгезию к основанию. После высыхания краска образует декоративное рельефное покрытие, скрывающие мелкие дефекты стен. Отличается высокой твердостью и атмосферостойкостью. Возможно последующее нанесение воднодисперсионной краски другого цвета на высохшее фактурное покрытие. Готова к применению.', '1'), ('b7e28649-21de-11df-860d-000e0c431b58', 'Краска фактурная Белый 9 кг ("Лакра")', '27566c6a-9ed8-11e3-96ad-005056be1f7b', '0', '11', '21', 'Краска представляет собой белую вязкую однородную массу. Удобна в нанесении, легка в обработке, имеет высокую адгезию к основанию. После высыхания краска образует декоративное рельефное покрытие, скрывающие мелкие дефекты стен. Отличается высокой твердостью и атмосферостойкостью. Возможно последующее нанесение воднодисперсионной краски другого цвета на высохшее фактурное покрытие. Готова к применению.', '1'), ('963b6b0a-04a8-11e3-94de-005056be3574', 'Штукатурка роллерная декоративная с эффектом "короеда" Белый 15кг', '27566c6a-9ed8-11e3-96ad-005056be1f7b', '0', '68', '14', 'Штукатурка фактурная ЛАКРА с эффект "короеда", готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии. Легко наносится валиком. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Допускает мытье окрашенной поверхности. Колеруется в светлые оттенки.', '1'), ('f5f1fcd6-d1c2-11e3-8b7a-005056be1f7b', 'Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 1,5мм Белый 15кг', '27566c6a-9ed8-11e3-96ad-005056be1f7b', '0', '39', '0', 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', '1'), ('0916172c-947c-11e3-8d88-005056be1f7b', 'Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 2мм Белый 15кг', '27566c6a-9ed8-11e3-96ad-005056be1f7b', '0', '46', '14', 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', '1'), ('fded4984-d1c2-11e3-8b7a-005056be1f7b', 'Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 13мм Белый 15кг', '27566c6a-9ed8-11e3-96ad-005056be1f7b', '0', '19', '0', 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', '1'), ('d5823752-947b-11e3-8d88-005056be1f7b', 'Штукатурка фактурная декоративная с эффектом "шубы" Белый 15кг', '27566c6a-9ed8-11e3-96ad-005056be1f7b', '0', '44', '14', 'Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии. Образует на поверхности рельеф в виде «шубы». Скрывает небольшие неровности основания. Легко наносится валиком. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Допускает мытье окрашенной поверхности.', '1'), ('076d216b-4380-11de-8f53-000e0c431b58', 'Колер Лакра №  1  Темно-корич. 100 мл', '076d216a-4380-11de-8f53-000e0c431b58', '0', '136', '90', 'Колер позволяет получать светлые оттенки, не оказывая влияния на глянец лакокрасочного покрытия. Предназначен для тонирования красок, штукатурок и шпатлевок на водной основе. Для декорирования фасадных поверхностей возможно использовать в концентрированном виде.', '1'), ('35c08333-4386-11de-8f53-000e0c431b58', 'Колер Лакра №  2  Зол-желт. 100 мл', '076d216a-4380-11de-8f53-000e0c431b58', '0', '166', '90', 'Колер позволяет получать светлые оттенки, не оказывая влияния на глянец лакокрасочного покрытия. Предназначен для тонирования красок, штукатурок и шпатлевок на водной основе. Для декорирования фасадных поверхностей возможно использовать в концентрированном виде.', '1'), ('35c08337-4386-11de-8f53-000e0c431b58', 'Колер Лакра №  3  Бежевый 100 мл', '076d216a